import React, { useState } from 'react'
import classes from './MenuHome.module.css'

const MenuHome = (props) => {
  const { link, active } = props
  const [listMenu, setListMenu] = useState([
    {
      id: 1,
      title: 'Home',
      active: false,
    },
    {
      id: 2,
      title: 'Course',
      active: false,
    },
    {
      id: 3,
      title: 'Become a teacher',
      active: false,
    },
    {
      id: 4,
      title: 'Account',
      active: false,
    },
  ])
  return (
    <div className={classes.AppHeaderMenu}>
      <ul className={classes.AppHeaderMenuItem}>
        {listMenu.map((item) => <li key={item.id}>
          <a
            href={link}
            onClick={setListMenu}
            className={active ? classes.active : null}
          >
            {item.title}
          </a>
        </li>)}
      </ul>
    </div>
  )
}
export default MenuHome
